  \"Biological, chemical, in situ, meteorological, navigational, physical and profile
  data collected by Hellenic Centre for Marine Research at OceanSITES site E1M3A from
  2007-08-01 to 2015-07-07 (NCEI Accession 0130474)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:23.005634\",\n\t\"name\": \"biological-chemical-in-situ-meteorological-navigational-physical-and-profile-data-collecte\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Biological, chemical, in situ, meteorological,
  navigational, physical and profile oceanographic data were collected, including
  AIR TEMPERATURE, BAROMETRIC PRESSURE, CHLOROPHYLL, CHLOROPHYLL A CONCENTRATION,
  CURRENT DIRECTION, CURRENT SPEED, CURRENT SPEED - EAST/WEST COMPONENT (U), DEPTH
  - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, SALINITY,
  SWELL HEIGHT, SWELL PERIOD, WATER TEMPERATURE, WAVE DIRECTION, WAVE HEIGHT - SIGNIFICANT,
  WAVE PERIOD, WIND DIRECTION, WIND GUST and WIND SPEED from Moored Buoy at the Mediterranean
  Moored Multi-sensor Array, Eastern Basin, Cretan Sea (E1M3A) using ADCP, CTD - moored
  CTD, anemometer, barometers, bottle, meteorological sensors and thermistor from
  2007-08-01 to 2015-07-07. These data were provided to one of the OceanSITES Data
  Assembly Centers (DAC). The DAC formatted this information into the OceanSITES file
  format and passed it on to the Global Data Assembly Centers (GDAC).OceanSITES is
  a worldwide system of long-term, open-ocean reference stations measuring dozens
  of variables and monitoring the full depth of the ocean from air-sea interactions
  down to the seafloor. It is a network of stations or observatories measuring many
  aspects of the ocean's surface and water column using, where possible, automated
  systems with advanced sensors and telecommunications systems, yielding high time
  resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
